//import PageThread from './components/PageThread'

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path={'/'}>
          <Home />
        </Route>
        
      </Routes>
    </BrowserRouter>
  )
}

export default App
